// pages/Transactions.jsx
import React from "react";
import { Table, TableBody, TableCell, TableHead, TableRow } from "@mui/material";

function Transactions({ transactions }) {
  return (
    <Table>
      <TableHead>
        <TableRow>
          <TableCell>ISIN</TableCell>
          <TableCell>Stock Name</TableCell>
          <TableCell>Quantity</TableCell>
          <TableCell>Date</TableCell>
          <TableCell>Type</TableCell>
          <TableCell>Total Cost</TableCell>
          <TableCell>DP Charges</TableCell>
          <TableCell>Other Charges</TableCell>
        </TableRow>
      </TableHead>
      <TableBody>
        {transactions.map((transaction, index) => (
          <TableRow key={index}>
            <TableCell>{transaction.ISIN}</TableCell>
            <TableCell>{transaction.stockName}</TableCell>
            <TableCell>{transaction.quantity}</TableCell>
            <TableCell>{transaction.date}</TableCell>
            <TableCell>{transaction.type}</TableCell>
            <TableCell>{transaction.totalCost}</TableCell>
            <TableCell>{transaction.dpCharges}</TableCell>
            <TableCell>{transaction.otherCharges}</TableCell>
          </TableRow>
        ))}
      </TableBody>
    </Table>
  );
}

export default Transactions;
